  false,\n\t\"url\": null,\n\t\"notes\": \"The objective of this study was to continue
  surveying and monitoring the birds and mammals of Kiska Island to establish baseline
  conditions prior to and the first breeding season after the experimental application
  of Compound 1080. The purpose of the project is to evaluate Compound 1080 as a potential
  introduced fox eradication tool on Kiska and perhaps other select islands within
  the Aleutian Islands Unit of the Alaska Maritime National Wildlife Refuge.\",\n\t\"owner_org\":
